import React from "react";
import { MDBContainer, MDBProgress, MDBRow, MDBCol } from 'mdbreact';
import './skills.css'


const skillsData = [
    {
        text: 'Html',
        value: 100,
    },

    {
        text: 'Css/Scss',
        value: 100,
    },

    {
        text: 'Js/Jquery',
        value: 50,
    },

    {
        text: 'Bootstrap',
        value: 80,
    },
]



const Skill = ({ data }) => (


    <MDBCol lg="4" sm="6">
        <div class="progress-container">
            <span class="percent" style={{ left: `calc(${data.value}% - 21px)` }}>{data.value}%</span>
            <h4>{data.text}</h4>
            <MDBProgress value={data.value} className="my-2 " />
        </div>
    </MDBCol>
);

const ProgressBarPage = () =>
    skillsData.length > 0 && (
        <section className='skills'>
            <div class="main-title text-center mb-5">
                <h2>My Skills</h2>
            </div>
            <MDBContainer>
                <MDBRow>

                    {skillsData.map((data, idx) => (
                        <Skill data={data} key={idx} />
                    ))}
                </MDBRow>
            </MDBContainer>
        </section>
    );


export default ProgressBarPage;
